import{_ as a}from"./plugin-vue_export-helper.21dcd24c.js";import{o as e,c as i,d as r}from"./app.d6b42b88.js";const p={},h=r('<h2 id="\u1100\u1162\u110B\u116D" tabindex="-1"><a class="header-anchor" href="#\u1100\u1162\u110B\u116D" aria-hidden="true">#</a> \uAC1C\uC694</h2><p>\uD070 \uC560\uD50C\uB9AC\uCF00\uC774\uC158\uC5D0\uC11C\uB294 \uB370\uC774\uD130\uB97C \uC811\uADFC\uD558\uACE0 \uCC98\uB9AC\uD558\uB294 \uB370 \uB2E4\uC591\uD55C \uBC29\uBC95\uC774 \uD544\uC694\uD558\uB2E4 \uD558\uC9C0\uB9CC \uB3D9\uC2DC\uC5D0 \uB2E4\uB978 \uBAA8\uB4E0 \uC694\uAD6C\uC0AC\uD56D\uC744 \uB9CC\uC871\uD558\uB294 \uD558\uB098\uC758 \uB370\uC774\uD130\uBCA0\uC774\uC2A4\uB294 \uC5C6\uB2E4. \uB300\uAC8C \uC5EC\uB7EC \uB2E4\uB978 \uB370\uC774\uD130\uC2A4\uD1A0\uC5B4, \uC0C9\uC778, \uCE90\uC2DC, \uBD84\uC11D \uC2DC\uC2A4\uD15C \uB4F1 \uBA87 \uAC00\uC9C0\uB97C \uC870\uD569\uD574\uC11C \uC0AC\uC6A9\uD558\uACE0 \uD55C \uC800\uC7A5\uC18C\uC5D0\uC11C \uB2E4\uB978 \uC800\uC7A5\uC18C\uB85C \uB370\uC774\uD130\uB97C \uC774\uB3D9\uD558\uB294 \uBA54\uCEE4\uB2C8\uC998\uC744 \uAD6C\uD604\uD55C\uB2E4 3\uBD80\uC5D0\uC11C\uB294 \uB370\uC774\uD130 \uBAA8\uB378\uB3C4 \uB2E4\uB974\uACE0 \uCD5C\uC801\uD654\uB41C \uC811\uADFC \uC591\uC2DD\uB3C4 \uB2E4\uB978 \uC5EC\uB7EC \uB370\uC774\uD130 \uC2DC\uC2A4\uD15C\uC744, \uC77C\uAD00\uC131 \uC788\uB294 \uD558\uB098\uC758 \uC560\uD50C\uB9AC\uCF00\uC774\uC158 \uC544\uD0A4\uD14D\uCC98\uB85C \uD1B5\uD569\uD558\uB294 \uBB38\uC81C\uB97C \uAC80\uD1A0\uD55C\uB2E4.</p><h3 id="\u1105\u1166\u110F\u1169\u1103\u1173-\u1109\u1175\u1109\u1173\u1110\u1166\u11B7-vs-\u1111\u1161\u1109\u1162\u11BC\u1103\u1166\u110B\u1175\u1110\u1165-\u1109\u1175\u1109\u1173\u1110\u1166\u11B7" tabindex="-1"><a class="header-anchor" href="#\u1105\u1166\u110F\u1169\u1103\u1173-\u1109\u1175\u1109\u1173\u1110\u1166\u11B7-vs-\u1111\u1161\u1109\u1162\u11BC\u1103\u1166\u110B\u1175\u1110\u1165-\u1109\u1175\u1109\u1173\u1110\u1166\u11B7" aria-hidden="true">#</a> \uB808\uCF54\uB4DC \uC2DC\uC2A4\uD15C vs \uD30C\uC0DD\uB370\uC774\uD130 \uC2DC\uC2A4\uD15C</h3><p>\uB370\uC774\uD130\uB97C \uC800\uC7A5\uD558\uACE0 \uCC98\uB9AC\uD558\uB294 \uC2DC\uC2A4\uD15C\uC740 \uD06C\uAC8C \uB450 \uBD84\uB958\uB85C \uB098\uB20C \uC218 \uC788\uB2E4.</p><ul><li><p>\uB808\uCF54\uB4DC \uC2DC\uC2A4\uD15C<br> \uBBFF\uC744 \uC218 \uC788\uB294 \uB370\uC774\uD130 \uBC84\uC804\uC744 \uC800\uC7A5\uD55C\uB2E4. \uB808\uCF54\uB4DC \uC2DC\uC2A4\uD15C\uC740 \uC9C4\uC2E4\uC758 \uADFC\uC6D0\uC774\uB77C\uACE0\uB3C4 \uD558\uB294\uB370 \uC608\uB97C \uB4E4\uC5B4 \uC0AC\uC6A9\uC790\uC758 \uC785\uB825\uACFC \uAC19\uC740 \uC0C8\uB85C\uC6B4 \uB370\uC774\uD130\uAC00 \uB4E4\uC5B4\uC624\uBA74 \uBA3C\uC800 \uB808\uCF54\uB4DC \uC2DC\uC2A4\uD15C\uC5D0 \uC800\uC7A5\uB41C\uB2E4. \uAC01 \uC0AC\uC2E4\uC740 \uC77C\uBC18\uC801\uC73C\uB85C \uC815\uADDC\uD654\uB97C \uAC70\uCCD0 \uC815\uD655\uD558\uAC8C \uD55C\uBC88 \uD45C\uD604\uB41C\uB2E4. \uB808\uCF54\uB4DC \uC2DC\uC2A4\uD15C\uACFC \uB2E4\uB978 \uC2DC\uC2A4\uD15C \uAC04\uC5D0 \uCC28\uC774\uAC00 \uB09C\uB2E4\uBA74 \uC815\uC758\uC5D0 \uB530\uB77C \uB808\uCF54\uB4DC \uC2DC\uC2A4\uD15C\uC774 \uC633\uB2E4.</p></li><li><p>\uD30C\uC0DD \uB370\uC774\uD130 \uC2DC\uC2A4\uD15C<br> \uD30C\uC0DD \uB370\uC774\uD130 \uC2DC\uC2A4\uD15C\uC5D0\uC11C\uB294 \uB370\uC774\uD130\uB294 \uB2E4\uB978 \uC2DC\uC2A4\uD15C\uC5D0 \uC874\uC7AC\uD558\uB294 \uB370\uC774\uD130\uB97C \uAC00\uC838\uC640 \uD2B9\uC815 \uBC29\uC2DD\uC73C\uB85C \uBCC0\uD658\uD558\uACE0 \uCC98\uB9AC\uD55C \uACB0\uACFC\uB2E4. \uD30C\uC0DD \uB370\uC774\uD130\uB97C \uC783\uAC8C \uB418\uB354\uB77C\uB3C4 \uC6D0\uCC9C \uB370\uC774\uD130\uB85C\uBD80\uD130 \uB2E4\uC2DC \uC0DD\uC131\uD560 \uC218 \uC788\uB2E4. \uB300\uD45C\uC801\uC778 \uC608\uAC00 \uCE90\uC2DC\uC778\uB370 \uD544\uC694\uD55C \uB370\uC774\uD130\uAC00 \uCE90\uC2DC\uC5D0 \uC788\uB2E4\uBA74 \uC81C\uACF5\uD558\uACE0, \uADF8\uB807\uC9C0 \uC54A\uB2E4\uBA74 \uAE30\uBC18 \uB370\uC774\uD130\uBCA0\uC774\uC2A4\uB97C \uAC70\uCCD0 \uC81C\uACF5\uD560 \uC218 \uC788\uB2E4. \uBE44\uC815\uADDC\uD654 \uAC12, \uC0C9\uC778, \uAD6C\uCCB4\uD654 \uBDF0 \uB4F1\uC774 \uC788\uB2E4. \uD30C\uC0DD \uB370\uC774\uD130\uB294 \uAE30\uC874 \uB370\uC774\uD130\uB97C \uBCF5\uC81C\uD55C\uB2E4\uB294 \uC758\uBBF8\uC5D0\uC11C \uC911\uBCF5(redundant)\uC774\uB2E4. \uD558\uC9C0\uB9CC \uC77D\uAE30 \uC9C8\uC758 \uC131\uB2A5\uC744 \uB192\uC774\uB294 \uB370 \uC885\uC885 \uD544\uC218\uC801\uC774\uB2E4. \uBE44\uC815\uADDC\uD654 \uACFC\uC815\uC744 \uD1B5\uD574 \uC0DD\uC131\uD55C\uB2E4. \uC2DC\uC2A4\uD15C \uC544\uD0A4\uD14D\uCC98\uB97C \uB9DD\uCE58\uC9C0 \uC54A\uACE0 \uBA85\uB8CC\uC131\uC744 \uAC16\uCD94\uAE30 \uC704\uD574\uC11C\uB294 \uB370\uC774\uD130\uAC00 \uC5B4\uB5A4 \uB370\uC774\uD130\uB85C\uBD80\uD130 \uD30C\uC0DD\uB410\uB294\uC9C0\uB97C \uBA85\uD655\uD788 \uD574\uC57C \uD55C\uB2E4.</p></li></ul><h3 id="\u1109\u1175\u1109\u1173\u1110\u1166\u11B7-\u110B\u1172\u1112\u1167\u11BC-3\u1100\u1161\u110C\u1175-\u1107\u116E\u11AB\u1105\u1172" tabindex="-1"><a class="header-anchor" href="#\u1109\u1175\u1109\u1173\u1110\u1166\u11B7-\u110B\u1172\u1112\u1167\u11BC-3\u1100\u1161\u110C\u1175-\u1107\u116E\u11AB\u1105\u1172" aria-hidden="true">#</a> \uC2DC\uC2A4\uD15C \uC720\uD615 3\uAC00\uC9C0 \uBD84\uB958</h3><p>\uC6F9\uACFC \uC810\uC810 \uB298\uC5B4\uB098\uACE0 \uC788\uB294 HTTP/REST \uAE30\uBC18 API \uB54C\uBB38\uC5D0 \uC694\uCCAD/\uC751\uB2F5 \uBC29\uC2DD\uC758 \uC0C1\uD638\uC791\uC6A9\uC774 \uB9E4\uC6B0 \uD754\uD574\uC838\uC788\uC9C0\uB9CC. \uC774 \uBC29\uBC95\uC774 \uC2DC\uC2A4\uD15C\uC744 \uAD6C\uCD95\uD558\uB294 \uC720\uC77C\uD55C \uBC29\uBC95\uC740 \uC544\uB2C8\uB2E4. \uC2DC\uC2A4\uD15C\uC744 3\uAC00\uC9C0 \uC720\uD615\uC73C\uB85C \uAD6C\uBD84\uD558\uBA74 \uC704\uC640 \uAC19\uC774 \uAD6C\uBD84\uD560 \uC218 \uC788\uB2E4.</p><ol><li><p>\uC11C\uBE44\uC2A4(\uC628\uB77C\uC778 \uC2DC\uC2A4\uD15C) : \uC11C\uBE44\uC2A4\uB294 \uD074\uB77C\uC774\uC5B8\uD2B8\uB85C\uBD80\uD130 \uC694\uCCAD\uC774\uB098 \uC9C0\uC2DC\uAC00 \uC62C \uB54C\uAE4C\uC9C0 \uAE30\uB2E4\uB9B0\uB2E4. \uC694\uCCAD\uC774 \uB4E4\uC5B4\uC624\uBA74 \uC11C\uBE44\uC2A4\uB294 \uAC00\uB2A5\uD55C \uBE68\uB9AC \uC694\uCCAD\uC744 \uCC98\uB9AC\uD574\uC11C \uC751\uB2F5\uC744 \uB418\uB3CC\uB824 \uBCF4\uB0B4\uB824 \uD55C\uB2E4. \uC96C\uC6A9 \uC131\uB2A5 \uC9C0\uD45C = \uC751\uB2F5 \uC2DC\uAC04</p></li><li><p>\uC77C\uAD04 \uCC98\uB9AC \uC2DC\uC2A4\uD15C(\uC624\uD504\uB77C\uC778 \uC2DC\uC2A4\uD15C) : \uC77C\uAD04 \uCC98\uB9AC \uC2DC\uC2A4\uD15C\uC740 \uB9E4\uC6B0 \uD070 \uC785\uB825 \uB370\uC774\uD130\uB97C \uBC1B\uC544 \uB370\uC774\uD130\uB97C \uCC98\uB9AC\uD558\uB294 \uC791\uC5C5\uC744 \uC218\uD589\uD558\uACE0 \uACB0\uACFC \uB370\uC774\uD130\uB97C \uC0DD\uC0B0\uD55C\uB2E4. \uC8FC\uC694 \uC131\uB2A5 \uC9C0\uD45C = \uCC98\uB9AC\uB7C9 (\uC785\uB825 \uB370\uC774\uD130 \uC911 \uD2B9\uC815 \uD06C\uAE30\uB9CC\uD07C \uCC98\uB9AC\uD560 \uB54C \uAC78\uB9AC\uB294 \uC2DC\uAC04)</p></li><li><p>\uC2A4\uD2B8\uB9BC \uCC98\uB9AC \uC2DC\uC2A4\uD15C(\uC900 \uC2E4\uC2DC\uAC04 \uC2DC\uC2A4\uD15C) : \uC77C\uAD04\uCC98\uB9AC \uC2DC\uC2A4\uD15C\uACFC \uB9C8\uCC2C\uAC00\uC9C0\uB85C \uC694\uCCAD\uC5D0 \uB300\uD574 \uC751\uB2F5 \uD558\uC9C0 \uC54A\uC73C\uBA70 \uC785\uB825\uB370\uC774\uD130\uB97C \uC18C\uBE44\uD558\uACE0 \uCD9C\uB825 \uB370\uC774\uD130\uB97C \uC0DD\uC0B0\uD55C\uB2E4. \uC77C\uAD04 \uCC98\uB9AC \uC791\uC5C5\uC740 \uC815\uD574\uC9C4 \uD06C\uAE30\uC758 \uC785\uB825 \uB370\uC774\uD130\uB97C \uB300\uC0C1\uC73C\uB85C \uC791\uB3D9\uD558\uC9C0\uB9CC \uC2A4\uD2B8\uB9BC \uCC98\uB9AC\uB294 \uC785\uB825 \uC774\uBCA4\uD2B8\uAC00 \uBC1C\uC0DD\uD55C \uC9C1\uD6C4 \uBC14\uB85C \uC791\uB3D9\uD55C\uB2E4. \uC77C\uAD04 \uCC98\uB9AC \uAE30\uBC18\uC774\uB098, \uC9C0\uC5F0 \uC2DC\uAC04\uC774 \uB0AE\uB2E4.</p></li></ol><h3 id="\u110B\u1175\u11AF\u1100\u116A\u11AF\u110E\u1165\u1105\u1175" tabindex="-1"><a class="header-anchor" href="#\u110B\u1175\u11AF\u1100\u116A\u11AF\u110E\u1165\u1105\u1175" aria-hidden="true">#</a> \uC77C\uAD04\uCC98\uB9AC</h3><p>\uC774 \uC911 \uC774\uBC88\uC7A5\uC5D0 \uC0B4\uD3B4\uBCFC \uC77C\uAD04\uCC98\uB9AC\uB294 \uC2E0\uB8B0\uC131\uC788\uACE0, \uD655\uC7A5\uAC00\uB2A5\uD558\uBA70 \uC720\uC9C0\uBCF4\uC218\uC131 \uC788\uB294 \uC560\uD50C\uB9AC\uCF00\uC774\uC158\uC744 \uAD6C\uCD95\uD558\uB294\uB370 \uB9E4\uC6B0 \uC911\uC694\uD55C \uAD6C\uC131\uC694\uC18C\uB2E4. 2004\uB144\uC5D0 \uBC1C\uD45C\uB41C \uC77C\uAD04\uCC98\uB9AC \uC54C\uACE0\uB9AC\uC998\uC778 \uB9F5\uB9AC\uB4C0\uC2A4(Map Reduce)\uB294 \uC57D\uAC04\uC758 \uACFC\uC7A5\uC744 \uBCF4\uD0DC \uAD6C\uAE00\uC744 \uB300\uADDC\uBAA8\uB85C \uD655\uC7A5\uAC00\uB2A5\uD558\uAC8C\uD55C \uC54C\uACE0\uB9AC\uC998 \uC73C\uB85C \uBD88\uB838\uB2E4. \uC77C\uAD04\uCC98\uB9AC\uB294 \uC0AC\uC2E4 \uCEF4\uD4E8\uD130 \uC5F0\uC0B0\uC5D0 \uC788\uC5B4 \uB9E4\uC6B0 \uC624\uB798\uB41C \uD615\uD0DC\uC774\uB2E4. \uC774\uBC88 \uC7A5\uC5D0\uC11C\uB294 \uB9F5\uB9AC\uB4C0\uC2A4\uB97C \uC54C\uC544\uBCF4\uC790. \uADF8\uC804\uC5D0 \uD45C\uC900 \uC720\uB2C9\uC2A4 \uB3C4\uAD6C\uB97C \uC0AC\uC6A9\uD574 \uB370\uC774\uD130\uB97C \uCC98\uB9AC\uD558\uB294 \uBC29\uBC95\uC744 \uC54C\uC544\uBCF8\uB2E4. \uC720\uB2C9\uC2A4 \uCCA0\uD559\uC744 \uB418\uC0C8\uACA8 \uBCF4\uB294\uAC83\uB3C4 \uB098\uB984 \uAC00\uCE58\uAC00 \uC788\uB2E4. \uC720\uB2C9\uC2A4\uAC00 \uC8FC\uB290 \uC544\uC774\uB514\uC5B4\uC640 \uAD50\uD6C8\uC774 \uB300\uADDC\uBAA8 \uC774\uAE30\uC885 \uBD84\uC0B0 \uC2DC\uC2A4\uD15D\uC73C\uB85C \uADF8\uB300\uB85C \uC774\uC5B4\uC9C0\uAE30 \uB54C\uBB38\uC774\uB2E4.</p><h2 id="\u110B\u1172\u1102\u1175\u11A8\u1109\u1173-\u110E\u1165\u11AF\u1112\u1161\u11A8" tabindex="-1"><a class="header-anchor" href="#\u110B\u1172\u1102\u1175\u11A8\u1109\u1173-\u110E\u1165\u11AF\u1112\u1161\u11A8" aria-hidden="true">#</a> \uC720\uB2C9\uC2A4 \uCCA0\uD559</h2><p>10\uC7A5\uC740 \uC720\uB2C9\uC2A4 \uB3C4\uAD6C\uC640 \uADF8\uC758 \uCCA0\uD559\uC5D0 \uB300\uD574 \uC54C\uC544\uBCF4\uB294 \uAC83\uBD80\uD130 \uC2DC\uC791\uD55C\uB2E4. \uC720\uB2C9\uC2A4\uB294 1970\uB144\uB300\uC5D0 \uB9CC\uB4E4\uC5B4\uC9C4 \uC6B4\uC601\uCCB4\uC81C\uB2E4. \uC624\uB798\uB41C \uC2DC\uC2A4\uD15C\uC774 \uC9C0\uAE08\uAE4C\uC9C0 \uC4F0\uC778\uB2E4\uB294\uAC74 \uADF8\uB9CC\uD07C \uC720\uB2C9\uC2A4\uAC00 \uC8FC\uB294 \uC544\uC774\uB514\uC5B4\uC640 \uAD50\uD6C8\uC774 \uAC15\uB825\uD558\uB2E4\uB294 \uC758\uBBF8\uAE30\uB3C4 \uD558\uB2E4. \uC624\uB298\uB0A0 \uC0AC\uC6A9\uB418\uB294 \uB300\uADDC\uBAA8 \uBD84\uC0B0 \uC2DC\uC2A4\uD15C\uC5D0\uC11C\uB3C4 \uC720\uB2C9\uC2A4 \uCCA0\uD559\uC774 \uC774\uC5B4\uC9C0\uB294 \uB3C4\uAD6C\uB4E4\uC774 \uB9CE\uB2E4.</p><blockquote><p>\u201C\uB2E4\uB978 \uBC29\uBC95\uC73C\uB85C \uB370\uC774\uD130 \uCC98\uB9AC\uAC00 \uD544\uC694\uD560 \uB54C \uC815\uC6D0 \uD638\uC2A4\uC640 \uAC19\uC774 \uC5EC\uB7EC \uB2E4\uB978 \uD504\uB85C\uADF8\uB7A8\uC744 \uC5F0\uACB0\uD558\uB294 \uBC29\uBC95\uC774 \uD544\uC694\uD558\uB2E4\u201D<br> -\uC720\uB2C9\uC2A4 \uD30C\uC774\uD504\uB97C \uBC1C\uBA85\uD55C \uB354\uADF8 \uB9E5\uAE00\uB85C\uC774(1964)</p></blockquote><p>1978\uB144 \uAE30\uC220\uB41C \uC720\uB2C9\uC2A4 \uCCA0\uD559\uC740 \uC544\uB798\uC640 \uAC19\uB2E4.</p><ol><li><p>\uAC01 \uD504\uB85C\uADF8\uB7A8\uC774 \uD55C \uAC00\uC9C0 \uC77C\uB9CC \uD558\uB3C4\uB85D \uC791\uC131\uD558\uB77C. \uC0C8 \uC791\uC5C5\uC744 \uD558\uB824\uBA74 \uAE30\uC874 \uD504\uB85C\uADF8\uB7A8\uC744 \uACE0\uCCD0 \uC0C8\uB85C\uC6B4 \u201C\uAE30\uB2A5\u201D\uC744 \uCD94\uAC00\uD574 \uD504\uB85C\uADF8\uB7A8\uC744 \uBCF5\uC7A1\uD558\uAC8C \uB9CC\uB4E4\uAE30\uBCF4\uB2E4\uB294 \uC0C8\uB85C\uC6B4 \uD504\uB85C\uADF8\uB7A8\uC744 \uC791\uC131\uD558\uB77C.</p></li><li><p>\uBAA8\uB4E0 \uD504\uB85C\uADF8\uB7A8\uC758 \uCD9C\uB825\uC740 \uC544\uC9C1 \uC54C\uB824\uC9C0\uC9C0 \uC54A\uC740 \uB2E4\uB978 \uD504\uB85C\uADF8\uB7A8\uC758 \uC785\uB825\uC73C\uB85C \uC4F0\uC77C \uC218 \uC788\uB2E4\uACE0 \uC0DD\uAC01\uD558\uB77C. \uBD88\uD544\uC694\uD55C \uC815\uBCF4\uB85C \uCD9C\uB825\uC774 \uB108\uC800\uBD84\uD574\uC11C\uB294 \uC548 \uB41C\uB2E4.</p></li><li><p>\uC18C\uD504\uD2B8\uC6E8\uC5B4\uB97C \uBE60\uB974\uAC8C \uC368\uBCFC \uC218 \uC788\uAC8C \uC124\uACC4\uD558\uACE0 \uAD6C\uCD95\uD558\uB77C. \uAC70\uC2AC\uB9AC\uB294 \uBD80\uBD84\uC740 \uACFC\uAC10\uD788 \uBC84\uB9AC\uACE0 \uC0C8\uB85C \uAD6C\uCD95\uD558\uB2E4.</p></li><li><p>\uD504\uB85C\uADF8\uB798\uBC0D \uC791\uC5C5\uC744 \uC904\uC774\uB824\uBA74 \uBBF8\uC219\uD55C \uB3C4\uC6C0\uBCF4\uB2E8 \uB3C4\uAD6C\uB97C \uC0AC\uC6A9\uD558\uB77C.</p></li></ol><p>\uC790\uB3D9\uD654, \uBE60\uB978 \uD504\uB85C\uD1A0 \uD0C0\uC774\uD551, \uC99D\uBD84 \uBC18\uBCF5, \uC2E4\uD5D8 \uCE5C\uD654, \uD070 \uD504\uB85C\uC81D\uD2B8\uB97C \uCCAD\uD06C\uB85C \uB098\uB204\uC5B4 \uCC98\uB9AC\uD558\uAE30\uC640 \uAC19\uC740 \uBC29\uBC95\uC740 \uC624\uB298\uB0A0\uC758 \uC560\uC790\uC77C \uBC0F DevOps \uC6B4\uB3D9\uACFC \uB9E4\uC6B0 \uD761\uC0AC\uD558\uB2E4.</p><p>bash \uAC19\uC740 \uC720\uB2C9\uC2A4 \uC178\uC744 \uC0AC\uC6A9\uD558\uBA74 \uC791\uC740 \uD504\uB85C\uADF8\uB7A8\uB4E4\uC744 \uAC00\uC9C0\uACE0 \uB180\uB784\uB9CC\uD07C \uAC15\uB825\uD55C \uB370\uC774\uD130 \uCC98\uB9AC \uC791\uC5C5\uC744 \uC27D\uAC8C \uAD6C\uC131\uD560 \uC218 \uC788\uB2E4. \uD504\uB85C\uADF8\uB7A8\uC911 \uB2E4\uC218\uB97C \uB2E4\uB978 \uADF8\uB8F9\uC5D0 \uC18D\uD558\uB294 \uC0AC\uB78C\uB4E4\uC774 \uB9CC\uB4E4\uC5C8\uC9C0\uB9CC \uC720\uC5F0\uD55C \uBC29\uC2DD\uC73C\uB85C \uD568\uAED8 \uC870\uD569\uD560 \uC218 \uC788\uB2E4. \uC720\uB2C9\uC2A4\uC5D0 \uC774\uB7F0 \uACB0\uD569\uC131\uC744 \uBD80\uC694\uD558\uB294 \uAC83\uC740 \uBB34\uC5C7\uC77C\uAE4C?</p><h3 id="_1-\u1103\u1169\u11BC\u110B\u1175\u11AF-\u110B\u1175\u11AB\u1110\u1165\u1111\u1166\u110B\u1175\u1109\u1173" tabindex="-1"><a class="header-anchor" href="#_1-\u1103\u1169\u11BC\u110B\u1175\u11AF-\u110B\u1175\u11AB\u1110\u1165\u1111\u1166\u110B\u1175\u1109\u1173" aria-hidden="true">#</a> 1. \uB3D9\uC77C \uC778\uD130\uD398\uC774\uC2A4</h3><p>\uC5B4\uB5A4 \uD504\uB85C\uADF8\uB7A8\uC758 \uCD9C\uB825\uC744 \uB2E4\uB978 \uD504\uB85C\uADF8\uB7A8\uC758 \uC785\uB825\uC73C\uB85C \uC4F0\uACE0\uC790 \uD55C\uB2E4\uBA74 \uD504\uB85C\uADF8\uB7A8\uC740 \uAC19\uC740 \uB370\uC774\uD130 \uD615\uC2DD\uC744 \uC0AC\uC6A9\uD574\uC57C \uD55C\uB2E4. <strong>\uD2B9\uC815 \uD504\uB85C\uADF8\uB7A8\uC774 \uB2E4\uB978 \uC5B4\uB5A4 \uD504\uB85C\uADF8\uB7A8\uACFC\uB3C4 \uC5F0\uACB0 \uAC00\uB2A5 \uD558\uB824\uBA74 \uD504\uB85C\uADF8\uB7A8 \uBAA8\uB450\uAC00 \uAC19\uC740 \uC785\uCD9C\uB825 \uC778\uD130\uD398\uC774\uC2A4\uB97C \uC0AC\uC6A9\uD574\uC57C \uD55C\uB2E4\uB294 \uC758\uBBF8\uB2E4.</strong></p><p>\uC720\uB2C9\uC2A4\uC5D0\uC11C \uC778\uD130\uD398\uC774\uC2A4\uB294 \uD30C\uC77C\uC774\uB2E4. \uD30C\uC77C\uC740 \uB2E8\uC9C0 \uC21C\uC11C\uB300\uB85C \uC815\uB82C\uB41C \uBC14\uC774\uD2B8\uC758 \uC5F0\uC18D\uC774\uB2E4. \uC774\uCC98\uB7FC \uB2E8\uC21C\uD574\uC11C \uAC19\uC740 \uC778\uD130\uD398\uC774\uC2A4\uB85C \uD30C\uC77C\uC2DC\uC2A4\uD15C\uC758 \uC2E4\uC81C \uD30C\uC77C, \uD504\uB85C\uC138\uC2A4 \uAC04\uC758 \uD1B5\uC2E0 \uCC44\uB110, \uC7A5\uCE58 \uB4DC\uB77C\uC774\uBC84, TCP \uC5F0\uACB0\uC744 \uB098\uD0C0\uB0B4\uB294 \uC18C\uCF13 \uB4F1 \uB2E4\uB978 \uC5EC\uB7EC \uAC00\uC9C0 \uAC83\uC744 \uD45C\uD604\uD560 \uC218 \uC788\uB2E4.</p><h3 id="_2-\u1105\u1169\u110C\u1175\u11A8\u1100\u116A-\u110B\u1167\u11AB\u1100\u1167\u11AF\u110B\u1174-\u1107\u116E\u11AB\u1105\u1175" tabindex="-1"><a class="header-anchor" href="#_2-\u1105\u1169\u110C\u1175\u11A8\u1100\u116A-\u110B\u1167\u11AB\u1100\u1167\u11AF\u110B\u1174-\u1107\u116E\u11AB\u1105\u1175" aria-hidden="true">#</a> 2. \uB85C\uC9C1\uACFC \uC5F0\uACB0\uC758 \uBD84\uB9AC</h3><p>\uC720\uB2C9\uC2A4 \uB3C4\uAD6C\uC758 \uB2E4\uB978 \uD2B9\uC9D5\uC73C\uB85C \uD45C\uC900 \uC785\uB825\uACFC \uD45C\uC900 \uCD9C\uB825\uC744 \uC0AC\uC6A9\uD55C\uB2E4\uB294 \uC810\uC774\uB2E4. \uD30C\uC774\uD504\uB294 \uD55C \uD504\uB85C\uC138\uC2A4\uC758 \uD45C\uC900\uCD9C\uB825\uC744 \uB2E4\uB978 \uD504\uB85C\uC138\uC2A4\uC758 \uD45C\uC900\uC785\uB825\uACFC \uC5F0\uACB0\uD55C\uB2E4. \uC774\uB54C \uC911\uAC04 \uB370\uC774\uD130\uB97C \uB514\uC2A4\uD06C\uC5D0 \uC4F0\uC9C0 \uC54A\uACE0 \uC791\uC740 \uC778\uBA54\uBAA8\uB9AC \uBC84\uD37C\uB97C \uC0AC\uC6A9\uD574 \uD504\uB85C\uC138\uC2A4 \uAC04 \uB370\uC774\uD130\uB97C \uC804\uC1A1\uD55C\uB2E4. \uD504\uB85C\uADF8\uB7A8\uC740 \uC785\uB825\uC774 \uC5B4\uB514\uC11C\uBD80\uD130 \uB4E4\uC5B4\uC624\uB294\uC9C0 \uCD9C\uB825\uC774 \uC5B4\uB514\uB85C \uB098\uAC00\uB294\uC9C0 \uC2E0\uACBD \uC4F0\uAC70\uB098 \uC54C \uD544\uC694\uC870\uCC28 \uC5C6\uB2E4.( \uC774\uB7F0 \uD615\uD0DC\uB97C \uB290\uC2A8\uD55C \uACB0\uD569, \uC9C0\uC5F0 \uBC14\uC778\uB529, \uC81C\uC5B4 \uBC18\uC804\uC774\uB77C \uD55C\uB2E4.) \uD504\uB85C\uADF8\uB7A8\uC5D0\uC11C \uC785\uCD9C\uB825\uC744 \uC5F0\uACB0\uD558\uB294 \uBD80\uBD84\uC744 \uBD84\uB9AC\uD558\uBA74 \uC791\uC740 \uB3C4\uAD6C\uB85C\uBD80\uD130 \uD070 \uC2DC\uC2A4\uD15C\uC744 \uAD6C\uC131\uD558\uAE30\uAC00 \uD6E8\uC52C \uC218\uC6D4\uD558\uB2E4. \uC5B4\uB5A4 \uD504\uB85C\uADF8\uB7A8\uC774\uB4E0 \uD45C\uC900 \uC785\uCD9C\uB825\uB9CC \uC9C0\uD0A4\uBA74 \uB370\uC774\uD130 \uCC98\uB9AC \uD30C\uC774\uD504\uB77C\uC778\uC5D0 \uBC14\uB85C \uB07C\uC6CC \uC0AC\uC6A9\uD560 \uC218 \uC788\uB2E4.</p><h3 id="_3-\u1110\u116E\u1106\u1167\u11BC\u1109\u1165\u11BC\u1100\u116A-\u1109\u1175\u11AF\u1112\u1165\u11B7" tabindex="-1"><a class="header-anchor" href="#_3-\u1110\u116E\u1106\u1167\u11BC\u1109\u1165\u11BC\u1100\u116A-\u1109\u1175\u11AF\u1112\u1165\u11B7" aria-hidden="true">#</a> 3. \uD22C\uBA85\uC131\uACFC \uC2E4\uD5D8</h3><p>\uC720\uB2C9\uC2A4\uB294 \uC9C4\uD589 \uC0AC\uD56D\uC744 \uD30C\uC545\uD558\uAE30\uAC00 \uC0C1\uB2F9\uD788 \uC27D\uB2E4.</p><ol><li><p>\uBA85\uB839\uC5D0 \uB4E4\uC5B4\uAC00\uB294 \uC785\uB825 \uD30C\uC77C\uC740 \uC77C\uBC18\uC801\uC73C\uB85C \uBD88\uBCC0\uC73C\uB85C \uCC98\uB9AC\uB41C\uB2E4.</p></li><li><p>\uC5B4\uB290 \uC2DC\uC810\uC774\uB4E0 \uD30C\uC774\uD504\uB77C\uC778\uC744 \uC911\uB2E8\uD558\uACE0 \uCD9C\uB825\uC744 \uD30C\uC774\uD504\uB97C \uD1B5\uD574 less\uB85C \uBCF4\uB0B4 \uC6D0\uD558\uB294 \uD615\uD0DC\uC758 \uCD9C\uB825\uC774 \uB098\uC624\uB294\uC9C0 \uD655\uC778\uD560 \uC218 \uC788\uB2E4. \uB514\uBC84\uAE45\uD560 \uB54C \uB9E4\uC6B0 \uC720\uC6A9</p></li><li><p>\uD2B9\uC815 \uD30C\uC774\uD504\uB77C\uC778 \uB2E8\uACC4\uC758 \uCD9C\uB825\uC744 \uD30C\uC77C\uC5D0 \uC4F0\uACE0 \uADF8 \uD30C\uC77C\uC744 \uB2E4\uC74C \uB2E8\uACC4\uC758 \uC785\uB825\uC73C\uB85C \uC0AC\uC6A9\uD560 \uC218 \uC788\uB2E4. \uC804\uCCB4 \uD30C\uC774\uD504\uB77C\uC778\uC744 \uB2E4\uC2DC \uC2DC\uC791\uD558\uC9C0 \uC54A\uACE0 \uB2E4\uC74C \uB2E8\uACC4\uBD80\uD130 \uC7AC\uC2DC\uC791 \uAC00\uB2A5</p></li></ol><p><strong>\uC720\uB2C9\uC2A4 \uB3C4\uAD6C\uB97C \uC0AC\uC6A9\uD558\uB294\uB370 \uAC00\uC7A5 \uD070 \uC81C\uC57D\uC740 \uB2E8\uC77C \uC7A5\uBE44\uC5D0\uC11C\uB9CC \uC2E4\uD589\uB41C\uB2E4\uB294 \uC810\uC774\uB2E4.</strong> \uC774 \uC810\uC774 \uD558\uB461 \uAC19\uC740 \uB3C4\uAD6C\uAC00 \uD544\uC694\uD55C \uC774\uC720\uB2E4.</p>',26),l=[h];function d(t,n){return e(),i("div",null,l)}var o=a(p,[["render",d],["__file","ch10-batch-processing-1.html.vue"]]);export{o as default};
